Variables are pretty much aliases that the programmers make for using memory to allocate some data. Obviously, we do not want, for our sanity's sake, to use memory addresses directly for accessing our data. That is really complicated, hard to remember, and an absolute nightmare to maintain. So, we instead assign these memory locations, containing our data, to names which we can use in our programs as needed. Clearly, variables are a crucial part of a programming language, and hence, Feral has it as well. Creating a variable is really easy. For example, if we want an integer data, say 20, to be stored in memory (and be accessible later), we can create a variable for that, say a, and use that when required. To do this, the variable can be created directly as: let a = 20; Since Feral is a dynamically typed language, we need not mention the data type of the value that we want to store manually. We can then use it later on, say in println, to print the value of this variable. To do that, we can do the following: let io = import('std/io');
let a = 20;
println(a); The will produce the output: 20

13.body:
We can also reassign the variables to different values later on. However, we need to remember that the data type of that variable cannot be changed throughout its lifetime. So, for example, if we create a variable a with value 20, we can change it later to, say 40, but we cannot change it to 'hi'. If we do something like that, the interpreter will throw an error. For example, if we write this program: let a = 20;
a = 'hi'; and execute it, the interpreter will throw the following error: /root/tmp.fer 2[3]: error: assignment requires type of lhs and rhs to be same, found lhs: int, rhs: string; to redeclare a variable using another type, use the 'let' statement
x = 'hi'; ^ Do note that in error message, Feral also provides us with a way to use same variable name for a different type: variable redeclaration. Using variable redeclaration, we can recreate a variable with an existing name. The old variable will cease to exist and the new variable will replace it. For example, let a = 20;
let a = 'hi'; On the second line, a is redeclared as a str (with value 'hi'). Now you can no longer assign an integer to it. Although the language is dynamically typed, it does impose some restrictions on it. We will understand more about the types in Feral in the next chapter - Data Types .

14.body:
The scope of a variable basically defines its lifetime - when it is created to when it is destroyed. Feral, like many other languages, uses braces to define chunks, or blocks , of code. Any variable that is created, has its lifetime bound to this block. It will not be accessible outside this block. For example: let a = 20; is globally scoped - it is not inside any set of braces, which means that it can be globally used anywhere and once created, it will not be destroyed until the end of the program (it will be available exactly from the location where it is created). On the other hand, if we declare the same variable as: { let a = 20;
} it will be accessible inside the set of braces (albeit after the creation - declaration of the variable), but not outside them. So, if we use the variable outside this set of braces (scope), say as follows: { let a = 20;
}
io.println(a); we will be greeted with the following error: /root/tmp.fer 5[12]: error: variable 'a' does not exist
io.println(a); ^ Of course, if we create another variable named a with some data outside the scope, that would work just fine. So something like this works: { let a = 20;
}
let a = 'hi';
io.println(a); which will produce the following output: hi Note that we can choose a different data type even when the variable name is same. The reason being that even though having same names, both of the declared variables are actually totally different. The first one, having data 20, no longer exists after the scope, therefore, the second one, having data hi, is a new variable declaration.

24.body:
Feral has an io function scan() which allows the programmer to take user input. It can optionally take in a prompt string and returns the input entered by the user as a string. The programmer has complete control to do whatever they want with this input string. For example, # taking simple input in a variable
let var1 = io.scan();
# taking input after a prompt
let var2 = io.scan('Enter some data: '); In the second case, the user will first be greeted by Enter some data: and they can provide input after that. Similar to the output from print function, this prompt will not append a newline character at the end automatically. If we want a newline character at the end, we will have to manually add that like so: let var = io.scan('Enter some data in next line:\n'); Let's understand this better using a very simple program extending our Hello world program. This time, we want to ask the user their name, and we will print Hello, <their name>. Basically, we will be doing three things: Giving prompt and taking input Storing the input in a variable Displaying our message Ideally, you should try to making such a program by yourself first, but for this guide, here is the solution: let name = io.scan('Enter your name: ');
io.println('Hello, ', name); That's it! Easy right?! There is one more input function scaneof. The only difference between scan and scaneof is that scaneof reads till it finds the EOF character in the input. Therefore, scaneof can span multiple lines, unlike the scan function which reads only a single line at a time. Well, there isn't anything else to learn about input for now. The scan function will most likely be extended later on to perhaps provide more fine grain control over taking input. This guide has used the term function a lot of times. Next up, it is time to understand what exactly they are and how to work with them in Feral.

