In Feral, we define functions using the keyword fn. This marks the beginning of a function definition and we then describe the function. Let's work on this using our dear old Hello world example. Last time, we were able to ask user to enter their name, store it in a variable, and display our hello message to the user in the Hello, <user> format. This time, we will create a function named hello to which we will pass the name of the user as an argument and that function will print the hello message for us. So, here's the code for that. let io = import('std/io');
# function definition
let hello = fn(name) { io.println('Hello, ', name);
}; let name = io.scan('Enter your name: ');
# function call
hello(name); Do note that variable names can be anything you like. The names given here are not set in stone. But yes, congratulations on making your first function in Feral! Now, to understand what we have written. Function definitions start with the keyword fn. Then comes the argument names for the function within parenthesis - multiple arguments separated by commas and empty parentheses for no argument, and then we have our function body within curly braces. To use a function, we simply call it by using the function name with parentheses and the actual arguments (our data) within the parentheses. Again, for no arguments, empty parentheses are required. Since functions are expressions in Feral, they can be stored in variables too! This is how we assigned an anonymous function - a nameless function, to the variable hello in this case. Hence, just like any other variable, we can pass this around to functions, as well make a new variable out of it, like so. let func1 = fn(a, b) { return a + b;
}; let func2 = func1; # now func2 is also the same function as func1 Feral also has the concept of type bound functions which are used similar to member functions. But we'll discuss about them in a later chapter. For now, time to move on to the next topic - Conditionals!

29.body:
Conditionals are the decision making constructs in programming - and in Feral. In essence, if we want some actions - statements to be executed based on some prerequisites or criteria, we use conditionals. In Feral, like most languages, conditional construct exists in the format: if <some expression> { # do something;
} elif <perhaps, some other expression> { # do some other thing;
} else { # oh well, none of the above worked, so let's just do this
} Do note that the elif and else portions are not mandatory. But the order - first if, then elif, then else is absolute. Also, a conditional can have any number of elifs. if states the starting of a conditional. Right after if, Feral expects an expression (a set of calculations & function calls that return some value) that evaluates to a boolean value. The boolean, if true will cause the block of if, which is right after the expression - beginning with an opening brace, to be executed. If the boolean, however, is false, the block is not executed. Instead, if there is elif, its expression will be checked and this process will continue. If none of the conditions work, and there is an else block, that will be executed. For example, let io = import('std/io'); let a = 2;
if a == 1 { io.println('one');
} elif a == 2 { io.println('two');
} else { io.println('i dunno');
} In this case, the elif block will be executed since a == 2 will evaluate to true. That's it for conditionals actually. Next up, we'll be learning about the various loop constructs in Feral.

30.body:
Loops are sequences of code that run over and over again, often as long as some condition is specified. They, like functions, help a lot in reducing redundant pieces of code. For example, if we want to make a multiplication table of 12 from 1 to 10, would we write 10 statements by hand? It would look something like this: let io = import('std/io'); io.println('12 x 1 = ', 12 * 1);
io.println('12 x 2 = ', 12 * 2);
io.println('12 x 3 = ', 12 * 3);
io.println('12 x 4 = ', 12 * 4);
io.println('12 x 5 = ', 12 * 5);
io.println('12 x 6 = ', 12 * 6);
io.println('12 x 7 = ', 12 * 7);
io.println('12 x 8 = ', 12 * 8);
io.println('12 x 9 = ', 12 * 9);
io.println('12 x 10 = ', 12 * 10); Well, that works I suppose, is it convenient? Nope, but is it really hard? Well, again nope. But think about it. This is just from 1 to 10. What about 1 to 100? Or 1 to 1000? Yeah, that becomes far more incovenient now. Downright dreadful even. That's where loops come in to save the day! Using a loop, the above program could be written as: let io = import('std/io'); for let i = 1; i <= 10; ++i { io.println('12 x ', i, ' = ', 12 * i);
} Yep, that's it! And if, say, we want to do this even for 1000, all we have to do is change the i <= 10 condition to i <= 1000, and boom! It's done! This is a really basic example of loops but it should suffice for now. Feral has 3 kinds of loops: Simple for loop foreach loop while loop

33.body:
Imagine for loop, but remove the initialization and increment/decrement components. That literally is while loop. This loop can be represented by for as well, but hey, it's syntactic sugar! It avoids the awkwardness of having two useless semicolons (';') that we have to deal with if we use for loop without the initialization and increment/decrement components. An example of the while loop using vectors/lists can be: let io = import('std/io');
let vec = import('std/vec'); let v = vec.new(1, 2, 3, 4); while !v.empty() { v.pop();
} This is a simple program that just keeps on deleting the last element of the vector until there is nothing left. The same thing, using normal for loop would be: let io = import('std/io');
let vec = import('std/vec'); let v = vec.new(1, 2, 3, 4); for ; !v.empty(); { v.pop();
} Not quite pleasing, is it! Anyway, that's the fundamentals of loops. Next up, we are going to cover the member functions in Feral.

