The io.println function adds a new line at the end of each call, so we did not have to write a new line character (\n). But if we want to explicitly write new line characters wherever required without the function doing that internally, we can use the io.print function for that. For example, if we want to display multiple statements without newline, using print: io.print('first line');
io.print('second line'); The output would be: first linesecond line To correct this, we will add a new line at the end of the first print call. io.print('first line\n');
io.print('second line'); which then gives us the correct output: first line
second line One more important thing to add here is that print and println can take any number of arguments (but at least one for print) by separating each argument with a comma (,). So, something like this is possible: io.println('Hello, ', 'world'); Finally, please remember that for using print(ln), the io module must be loaded. We will talk about modules later, but from now on, it will be assumed that wherever print(ln) is used, the io module has been already imported.
